class Solution {
    
    func findRepeatedDnaSequences(_ s: String) -> [String] {
        guard s.count > 10 else { return [String]() }

        var map = [String: Int]()
        var curr = ""
        var index = 0
        
        for ch in s {
            curr.append(ch)
            if index >= 9 {
                map[curr, default: 0] += 1
                curr.removeFirst()
            }
            index += 1
        }
        
        return map.reduce([String]()) { $1.value > 1 ? $0 + [$1.key] : $0 }
    }
